@testset "4.3.3.1 (a+b tan)^m (c+d tan)^n (A+B tan)" begin
    (A, B, a, b, c, d, e, f, m, n, x, ) = @variables A B a b c d e f m n x

    #= ::Package:: =#

    #= ::Title::Closed:: =#
    #=Integrands*of*the*form*(d*tan(e+f*x))^m*(a+b*tan(e+f*x))^n*(A+B*tan(e+f*x))=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(d*tan(e+f*x))^m*(a+a*im*tan(e+f*x))^n*(A+B*tan(e+f*x))=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*tan(c+d*x)^m*(A+B*tan(c+d*x))*(a+i*a*tan(c+d*x))^n=#


    #= ::Subsubsection::Closed:: =#
    #=n>0=#


    @test_int [tan(c + d*x)^2*(a + im*a*tan(c + d*x))*(A + B*tan(c + d*x)), x, 4, -(a*(A - im*B)*x) + (a*(im*A + B)*log(cos(c + d*x)))/d + (a*(A - im*B)*tan(c + d*x))/d + (a*(im*A + B)*tan(c + d*x)^2)/(2*d) + ((im/3)*a*B*tan(c + d*x)^3)/d]
    @test_int [tan(c + d*x)^1*(a + im*a*tan(c + d*x))*(A + B*tan(c + d*x)), x, 3, -(a*(im*A + B)*x) - (a*(A - im*B)*log(cos(c + d*x)))/d + (a*(im*A + B)*tan(c + d*x))/d + ((im/2)*a*B*tan(c + d*x)^2)/d]
    @test_int [tan(c + d*x)^0*(a + im*a*tan(c + d*x))*(A + B*tan(c + d*x)), x, 2, a*(A - im*B)*x - (a*(im*A + B)*log(cos(c + d*x)))/d + im*a*B*tan(c + d*x)/d]
    @test_int [cot(c + d*x)^1*(a + im*a*tan(c + d*x))*(A + B*tan(c + d*x)), x, 4, a*(im*A + B)*x - (im*a*B*log(cos(c + d*x)))/d + (a*A*log(sin(c + d*x)))/d]
    @test_int [cot(c + d*x)^2*(a + im*a*tan(c + d*x))*(A + B*tan(c + d*x)), x, 3, -(a*(A - im*B)*x) - (a*A*cot(c + d*x))/d + (a*(im*A + B)*log(sin(c + d*x)))/d]
    @test_int [cot(c + d*x)^3*(a + im*a*tan(c + d*x))*(A + B*tan(c + d*x)), x, 4, -(a*(im*A + B)*x) - (a*(im*A + B)*cot(c + d*x))/d - (a*A*cot(c + d*x)^2)/(2*d) - (a*(A - im*B)*log(sin(c + d*x)))/d]
    @test_int [cot(c + d*x)^4*(a + im*a*tan(c + d*x))*(A + B*tan(c + d*x)), x, 5, a*(A - im*B)*x + (a*(A - im*B)*cot(c + d*x))/d - (a*(im*A + B)*cot(c + d*x)^2)/(2*d) - (a*A*cot(c + d*x)^3)/(3*d) - (a*(im*A + B)*log(sin(c + d*x)))/d]
    @test_int [cot(c + d*x)^5*(a + im*a*tan(c + d*x))*(A + B*tan(c + d*x)), x, 6, a*(im*A + B)*x + (a*(im*A + B)*cot(c + d*x))/d + (a*(A - im*B)*cot(c + d*x)^2)/(2*d) - (a*(im*A + B)*cot(c + d*x)^3)/(3*d) - (a*A*cot(c + d*x)^4)/(4*d) + (a*(A - im*B)*log(sin(c + d*x)))/d]


    @test_int [tan(c + d*x)^2*(a + im*a*tan(c + d*x))^2*(A + B*tan(c + d*x)), x, 5, -2*a^2*(A - im*B)*x + (2*a^2*(im*A + B)*log(cos(c + d*x)))/d + (2*a^2*(A - im*B)*tan(c + d*x))/d + (a^2*(im*A + B)*tan(c + d*x)^2)/d - (a^2*(4*A - (5*im)*B)*tan(c + d*x)^3)/(12*d) + ((im/4)*B*tan(c + d*x)^3*(a^2 + im*a^2*tan(c + d*x)))/d]
    @test_int [tan(c + d*x)*(a + im*a*tan(c + d*x))^2*(A + B*tan(c + d*x)), x, 4, -2*a^2*(im*A + B)*x - (2*a^2*(A - im*B)*log(cos(c + d*x)))/d + (a^2*(im*A + B)*tan(c + d*x))/d + (A*(a + im*a*tan(c + d*x))^2)/(2*d) - ((im/3)*B*(a + im*a*tan(c + d*x))^3)/(a*d)]
    @test_int [(a + im*a*tan(c + d*x))^2*(A + B*tan(c + d*x)), x, 3, 2*a^2*(A - im*B)*x - (2*a^2*(im*A + B)*log(cos(c + d*x)))/d - (a^2*(A - im*B)*tan(c + d*x))/d + (B*(a + im*a*tan(c + d*x))^2)/(2*d)]
    @test_int [cot(c + d*x)*(a + im*a*tan(c + d*x))^2*(A + B*tan(c + d*x)), x, 5, 2*a^2*(im*A + B)*x + (a^2*(A - (2*im)*B)*log(cos(c + d*x)))/d + (a^2*A*log(sin(c + d*x)))/d + (im*B*(a^2 + im*a^2*tan(c + d*x)))/d]
    @test_int [cot(c + d*x)^2*(a + im*a*tan(c + d*x))^2*(A + B*tan(c + d*x)), x, 5, -2*a^2*(A - im*B)*x + (a^2*B*log(cos(c + d*x)))/d + (a^2*((2*im)*A + B)*log(sin(c + d*x)))/d - (A*cot(c + d*x)*(a^2 + im*a^2*tan(c + d*x)))/d]
    @test_int [cot(c + d*x)^3*(a + im*a*tan(c + d*x))^2*(A + B*tan(c + d*x)), x, 4, -2*a^2*(im*A + B)*x - (a^2*((3*im)*A + 2*B)*cot(c + d*x))/(2*d) - (2*a^2*(A - im*B)*log(sin(c + d*x)))/d - (A*cot(c + d*x)^2*(a^2 + im*a^2*tan(c + d*x)))/(2*d)]
    @test_int [cot(c + d*x)^4*(a + im*a*tan(c + d*x))^2*(A + B*tan(c + d*x)), x, 5, 2*a^2*(A - im*B)*x + (2*a^2*(A - im*B)*cot(c + d*x))/d - (a^2*((4*im)*A + 3*B)*cot(c + d*x)^2)/(6*d) - (2*a^2*(im*A + B)*log(sin(c + d*x)))/d - (A*cot(c + d*x)^3*(a^2 + im*a^2*tan(c + d*x)))/(3*d)]
    @test_int [cot(c + d*x)^5*(a + im*a*tan(c + d*x))^2*(A + B*tan(c + d*x)), x, 6, 2*a^2*(im*A + B)*x + (2*a^2*(im*A + B)*cot(c + d*x))/d + (a^2*(A - im*B)*cot(c + d*x)^2)/d - (a^2*((5*im)*A + 4*B)*cot(c + d*x)^3)/(12*d) + (2*a^2*(A - im*B)*log(sin(c + d*x)))/d - (A*cot(c + d*x)^4*(a^2 + im*a^2*tan(c + d*x)))/(4*d)]


    @test_int [tan(c + d*x)^2*(a + im*a*tan(c + d*x))^3*(A + B*tan(c + d*x)), x, 6, -4*a^3*(A - im*B)*x + (4*a^3*(im*A + B)*log(cos(c + d*x)))/d + (4*a^3*(A - im*B)*tan(c + d*x))/d + (2*a^3*(im*A + B)*tan(c + d*x)^2)/d - (a^3*(45*A - (47*im)*B)*tan(c + d*x)^3)/(60*d) + ((im/5)*a*B*tan(c + d*x)^3*(a + im*a*tan(c + d*x))^2)/d - ((5*A - (7*im)*B)*tan(c + d*x)^3*(a^3 + im*a^3*tan(c + d*x)))/(20*d)]
    @test_int [tan(c + d*x)*(a + im*a*tan(c + d*x))^3*(A + B*tan(c + d*x)), x, 5, -4*a^3*(im*A + B)*x - (4*a^3*(A - im*B)*log(cos(c + d*x)))/d + (2*a^3*(im*A + B)*tan(c + d*x))/d + (a*(A - im*B)*(a + im*a*tan(c + d*x))^2)/(2*d) + (A*(a + im*a*tan(c + d*x))^3)/(3*d) - ((im/4)*B*(a + im*a*tan(c + d*x))^4)/(a*d)]
    @test_int [(a + im*a*tan(c + d*x))^3*(A + B*tan(c + d*x)), x, 4, 4*a^3*(A - im*B)*x - (4*a^3*(im*A + B)*log(cos(c + d*x)))/d - (2*a^3*(A - im*B)*tan(c + d*x))/d + (a*(im*A + B)*(a + im*a*tan(c + d*x))^2)/(2*d) + (B*(a + im*a*tan(c + d*x))^3)/(3*d)]
    @test_int [cot(c + d*x)*(a + im*a*tan(c + d*x))^3*(A + B*tan(c + d*x)), x, 6, 4*a^3*(im*A + B)*x + (a^3*(3*A - (4*im)*B)*log(cos(c + d*x)))/d + (a^3*A*log(sin(c + d*x)))/d + ((im/2)*a*B*(a + im*a*tan(c + d*x))^2)/d - ((A - (2*im)*B)*(a^3 + im*a^3*tan(c + d*x)))/d]
    @test_int [cot(c + d*x)^2*(a + im*a*tan(c + d*x))^3*(A + B*tan(c + d*x)), x, 6, -4*a^3*(A - im*B)*x + (a^3*(im*A + 3*B)*log(cos(c + d*x)))/d + (a^3*(3*im*A + B)*log(sin(c + d*x)))/d - (a*A*cot(c + d*x)*(a + im*a*tan(c + d*x))^2)/d + ((im*A - B)*(a^3 + im*a^3*tan(c + d*x)))/d]
    @test_int [cot(c + d*x)^3*(a + im*a*tan(c + d*x))^3*(A + B*tan(c + d*x)), x, 6, -4*a^3*(im*A + B)*x + (im*a^3*B*log(cos(c + d*x)))/d - (a^3*(4*A - (3*im)*B)*log(sin(c + d*x)))/d - (a*A*cot(c + d*x)^2*(a + im*a*tan(c + d*x))^2)/(2*d) - (((2*im)*A + B)*cot(c + d*x)*(a^3 + im*a^3*tan(c + d*x)))/d]
    @test_int [cot(c + d*x)^4*(a + im*a*tan(c + d*x))^3*(A + B*tan(c + d*x)), x, 5, 4*a^3*(A - im*B)*x + (a^3*(17*A - (15*im)*B)*cot(c + d*x))/(6*d) - (4*a^3*(im*A + B)*log(sin(c + d*x)))/d - (a*A*cot(c + d*x)^3*(a + im*a*tan(c + d*x))^2)/(3*d) - (((5*im)*A + 3*B)*cot(c + d*x)^2*(a^3 + im*a^3*tan(c + d*x)))/(6*d)]
    @test_int [cot(c + d*x)^5*(a + im*a*tan(c + d*x))^3*(A + B*tan(c + d*x)), x, 6, 4*a^3*(im*A + B)*x + (4*a^3*(im*A + B)*cot(c + d*x))/d + (a^3*(15*A - (14*im)*B)*cot(c + d*x)^2)/(12*d) + (4*a^3*(A - im*B)*log(sin(c + d*x)))/d - (a*A*cot(c + d*x)^4*(a + im*a*tan(c + d*x))^2)/(4*d) - (((3*im)*A + 2*B)*cot(c + d*x)^3*(a^3 + im*a^3*tan(c + d*x)))/(6*d)]
    @test_int [cot(c + d*x)^6*(a + im*a*tan(c + d*x))^3*(A + B*tan(c + d*x)), x, 7, -4*a^3*(A - im*B)*x - (4*a^3*(A - im*B)*cot(c + d*x))/d + (2*a^3*(im*A + B)*cot(c + d*x)^2)/d + (a^3*(47*A - (45*im)*B)*cot(c + d*x)^3)/(60*d) + (4*a^3*(im*A + B)*log(sin(c + d*x)))/d - (a*A*cot(c + d*x)^5*(a + im*a*tan(c + d*x))^2)/(5*d) - (((7*im)*A + 5*B)*cot(c + d*x)^4*(a^3 + im*a^3*tan(c + d*x)))/(20*d)]


    @test_int [tan(c + d*x)^2*(a + im*a*tan(c + d*x))^4*(A + B*tan(c + d*x)), x, 7, -8*a^4*(A - im*B)*x + (8*a^4*(im*A + B)*log(cos(c + d*x)))/d + (8*a^4*(A - im*B)*tan(c + d*x))/d + (4*a^4*(im*A + B)*tan(c + d*x)^2)/d - (a^4*(92*A - (93*im)*B)*tan(c + d*x)^3)/(60*d) + ((im/6)*a*B*tan(c + d*x)^3*(a + im*a*tan(c + d*x))^3)/d - ((2*A - (3*im)*B)*tan(c + d*x)^3*(a^2 + im*a^2*tan(c + d*x))^2)/(10*d) - ((12*A - (13*im)*B)*tan(c + d*x)^3*(a^4 + im*a^4*tan(c + d*x)))/(20*d)]
    @test_int [tan(c + d*x)*(a + im*a*tan(c + d*x))^4*(A + B*tan(c + d*x)), x, 6, -8*a^4*(im*A + B)*x - (8*a^4*(A - im*B)*log(cos(c + d*x)))/d + (4*a^4*(im*A + B)*tan(c + d*x))/d + (a*(A - im*B)*(a + im*a*tan(c + d*x))^3)/(3*d) + (A*(a + im*a*tan(c + d*x))^4)/(4*d) - ((im/5)*B*(a + im*a*tan(c + d*x))^5)/(a*d) + ((A - im*B)*(a^2 + im*a^2*tan(c + d*x))^2)/d]
    @test_int [(a + im*a*tan(c + d*x))^4*(A + B*tan(c + d*x)), x, 5, 8*a^4*(A - im*B)*x - (8*a^4*(im*A + B)*log(cos(c + d*x)))/d - (4*a^4*(A - im*B)*tan(c + d*x))/d + (a*(im*A + B)*(a + im*a*tan(c + d*x))^3)/(3*d) + (B*(a + im*a*tan(c + d*x))^4)/(4*d) + ((im*A + B)*(a^2 + im*a^2*tan(c + d*x))^2)/d]
    @test_int [cot(c + d*x)*(a + im*a*tan(c + d*x))^4*(A + B*tan(c + d*x)), x, 7, 8*a^4*(im*A + B)*x + (a^4*(7*A - (8*im)*B)*log(cos(c + d*x)))/d + (a^4*A*log(sin(c + d*x)))/d + ((im/3)*a*B*(a + im*a*tan(c + d*x))^3)/d - ((A - (2*im)*B)*(a^2 + im*a^2*tan(c + d*x))^2)/(2*d) - ((3*A - (4*im)*B)*(a^4 + im*a^4*tan(c + d*x)))/d]
    @test_int [cot(c + d*x)^2*(a + im*a*tan(c + d*x))^4*(A + B*tan(c + d*x)), x, 7, -8*a^4*(A - im*B)*x + (a^4*(4*im*A + 7*B)*log(cos(c + d*x)))/d + (a^4*(4*im*A + B)*log(sin(c + d*x)))/d - (a*A*cot(c + d*x)*(a + im*a*tan(c + d*x))^3)/d + ((2*im*A - B)*(a^2 + im*a^2*tan(c + d*x))^2)/(2*d) - (3*B*(a^4 + im*a^4*tan(c + d*x)))/d]
    @test_int [cot(c + d*x)^3*(a + im*a*tan(c + d*x))^4*(A + B*tan(c + d*x)), x, 7, -8*a^4*(im*A + B)*x - (a^4*(A - (4*im)*B)*log(cos(c + d*x)))/d - (a^4*(7*A - (4*im)*B)*log(sin(c + d*x)))/d - (a*A*cot(c + d*x)^2*(a + im*a*tan(c + d*x))^3)/(2*d) - (((5*im)*A + 2*B)*cot(c + d*x)*(a^2 + im*a^2*tan(c + d*x))^2)/(2*d) - (3*A*(a^4 + im*a^4*tan(c + d*x)))/d]
    @test_int [cot(c + d*x)^4*(a + im*a*tan(c + d*x))^4*(A + B*tan(c + d*x)), x, 7, 8*a^4*(A - im*B)*x - (a^4*B*log(cos(c + d*x)))/d - (a^4*((8*im)*A + 7*B)*log(sin(c + d*x)))/d - (a*A*cot(c + d*x)^3*(a + im*a*tan(c + d*x))^3)/(3*d) - (((2*im)*A + B)*cot(c + d*x)^2*(a^2 + im*a^2*tan(c + d*x))^2)/(2*d) + ((4*A - (3*im)*B)*cot(c + d*x)*(a^4 + im*a^4*tan(c + d*x)))/d]
    @test_int [cot(c + d*x)^5*(a + im*a*tan(c + d*x))^4*(A + B*tan(c + d*x)), x, 6, 8*a^4*(im*A + B)*x + (a^4*((67*im)*A + 64*B)*cot(c + d*x))/(12*d) + (8*a^4*(A - im*B)*log(sin(c + d*x)))/d - (a*A*cot(c + d*x)^4*(a + im*a*tan(c + d*x))^3)/(4*d) - (((7*im)*A + 4*B)*cot(c + d*x)^3*(a^2 + im*a^2*tan(c + d*x))^2)/(12*d) + ((19*A - (16*im)*B)*cot(c + d*x)^2*(a^4 + im*a^4*tan(c + d*x)))/(12*d)]
    @test_int [cot(c + d*x)^6*(a + im*a*tan(c + d*x))^4*(A + B*tan(c + d*x)), x, 7, -8*a^4*(A - im*B)*x - (8*a^4*(A - im*B)*cot(c + d*x))/d + (a^4*((148*im)*A + 145*B)*cot(c + d*x)^2)/(60*d) + (8*a^4*(im*A + B)*log(sin(c + d*x)))/d - (a*A*cot(c + d*x)^5*(a + im*a*tan(c + d*x))^3)/(5*d) - (((8*im)*A + 5*B)*cot(c + d*x)^4*(a^2 + im*a^2*tan(c + d*x))^2)/(20*d) + ((28*A - (25*im)*B)*cot(c + d*x)^3*(a^4 + im*a^4*tan(c + d*x)))/(30*d)]
    @test_int [cot(c + d*x)^7*(a + im*a*tan(c + d*x))^4*(A + B*tan(c + d*x)), x, 8, -8*a^4*(im*A + B)*x - (8*a^4*(im*A + B)*cot(c + d*x))/d - (4*a^4*(A - im*B)*cot(c + d*x)^2)/d + (a^4*((93*im)*A + 92*B)*cot(c + d*x)^3)/(60*d) - (8*a^4*(A - im*B)*log(sin(c + d*x)))/d - (a*A*cot(c + d*x)^6*(a + im*a*tan(c + d*x))^3)/(6*d) - (((3*im)*A + 2*B)*cot(c + d*x)^5*(a^2 + im*a^2*tan(c + d*x))^2)/(10*d) + ((13*A - (12*im)*B)*cot(c + d*x)^4*(a^4 + im*a^4*tan(c + d*x)))/(20*d)]


    #= ::Subsubsection::Closed:: =#
    #=n<0=#


    @test_int [(tan(c + d*x)^3*(A + B*tan(c + d*x)))/(a + im*a*tan(c + d*x)), x, 4, (3*(im*A - B)*x)/(2*a) - ((A + 2*im*B)*log(cos(c + d*x)))/(a*d) - (3*(im*A - B)*tan(c + d*x))/(2*a*d) - ((A + 2*im*B)*tan(c + d*x)^2)/(2*a*d) + ((im*A - B)*tan(c + d*x)^3)/(2*d*(a + im*a*tan(c + d*x)))]
    @test_int [(tan(c + d*x)^2*(A + B*tan(c + d*x)))/(a + im*a*tan(c + d*x)), x, 3, ((A + 3*im*B)*x)/(2*a) + ((im*A - B)*log(cos(c + d*x)))/(a*d) - ((A + 3*im*B)*tan(c + d*x))/(2*a*d) + ((im*A - B)*tan(c + d*x)^2)/(2*d*(a + im*a*tan(c + d*x)))]
    @test_int [(tan(c + d*x)*(A + B*tan(c + d*x)))/(a + im*a*tan(c + d*x)), x, 5, -(((im*A - B)*x)/(2*a)) + (im*B*log(cos(c + d*x)))/(a*d) - (A + im*B)/(2*a*d*(1 + im*tan(c + d*x)))]
    @test_int [(A + B*tan(c + d*x))/(a + im*a*tan(c + d*x)), x, 2, ((A - im*B)*x)/(2*a) + (im*A - B)/(2*d*(a + im*a*tan(c + d*x)))]
    @test_int [(cot(c + d*x)*(A + B*tan(c + d*x)))/(a + im*a*tan(c + d*x)), x, 3, -(((im*A - B)*x)/(2*a)) + (A*log(sin(c + d*x)))/(a*d) + (A + im*B)/(2*d*(a + im*a*tan(c + d*x)))]
    @test_int [(cot(c + d*x)^2*(A + B*tan(c + d*x)))/(a + im*a*tan(c + d*x)), x, 4, -(((3*A + im*B)*x)/(2*a)) - ((3*A + im*B)*cot(c + d*x))/(2*a*d) - ((im*A - B)*log(sin(c + d*x)))/(a*d) + ((A + im*B)*cot(c + d*x))/(2*d*(a + im*a*tan(c + d*x)))]
    @test_int [(cot(c + d*x)^3*(A + B*tan(c + d*x)))/(a + im*a*tan(c + d*x)), x, 5, (3*(im*A - B)*x)/(2*a) + (3*(im*A - B)*cot(c + d*x))/(2*a*d) - ((2*A + im*B)*cot(c + d*x)^2)/(2*a*d) - ((2*A + im*B)*log(sin(c + d*x)))/(a*d) + ((A + im*B)*cot(c + d*x)^2)/(2*d*(a + im*a*tan(c + d*x)))]
